summary:
Create Windows Service with console mode for debug (one project, one click to deploy).
      
Here's a example:

class Program : IRunnable
{
    static void Main(string[] args)
    {
        WindowsService.Main(args);
    }

    // on service start
    public void Start()
    {
        Console.WriteLine("start");
    }

    // on service stop
    public void Stop()
    {
        Console.WriteLine("stop");
    }
}
